import React from "react";
import SideMenu from "../Side";
import {ContentBlock, ContentPage, ContentItem, ContentItemHeader, ContentItemBody} from "./styles";

const Content = ({content}) => {
    return (
        <ContentBlock>
            <SideMenu>
            </SideMenu>
            <ContentPage>
                <ContentItem>
                    <ContentItemHeader/>
                    <ContentItemBody>
                        {content}
                    </ContentItemBody>
                </ContentItem>
            </ContentPage>
        </ContentBlock>
    )
};

export default Content
